Harry Potter and the Half-Blood Prince (2009) 
Alternatieve titel: Harry Potter en de Halfbloed Prins 

Verenigd Koninkrijk / Verenigde Staten
Avontuur / Fantasy
153 minuten

geregisseerd door David Yates
met Daniel Radcliffe, Emma Watson en Rupert Grint

Als Harry, Ron en Hermelien aan hun zesde jaar aan Hogwarts beginnen, komt Harry in het bezit van een geheimzinnig volgekladderd toverdrankenboek, dat ooit het eigendom is geweest van de onbekende Half-Blood Prince. Wat moet Harry doen met de af en toe wel erg obscure spreuken die het boek vermeldt? En ondertussen heeft hij te kampen met een moeizaam sociaal leven en laat Dumbledore hem stukje bij beetje informatie zien over het duistere verleden van Voldemort. Deze lessen van Dumbledore zullen leiden tot het grootste geheim van de duistere heerser en het zal Harry helpen om te overleven.

